var e={"0":{title:"Lead D\xE9veloppeur / Lead Technique",shortDescription:"Manager du p\xF4le d\xE9v/technique, accompagnement des \xE9quipes marketing sur leurs projets clients ainsi que d\xE9velopper des outils internes et des sites de campagnes pour nos clients.",longDescription:"J'ai d'abord rejoints l'entreprise comme d\xE9veloppeur en stage puis alternance et en sortie d'\xE9cole j'ai \xE9t\xE9 nomm\xE9 Lead D\xE9veloppeur.<br/>Au d\xE9part, mon r\xF4le \xE9tait de d\xE9velopper des outils internes (ex : Prometer) et d'aider l\xE9g\xE8rement sur quelques projets clients.<br/>J'ai rapidement mont\xE9 en responsabilit\xE9, j'ai par la suite manag\xE9 le p\xF4le d\xE9v et aider \xE0 son d\xE9veloppement en recrutant des profils en stage et alternance. J'ai \xE9galement \xE9paul\xE9 les \xE9quipes marketings et cr\xE9atives sur la r\xE9alisation et la reflexion autours des projets clients : principalement en aidant \xE0 trouver la bonne solution technique pour r\xE9pondre au mieux au besoin client. J'\xE9tais souvent en relation avec les clients, je devais les aider \xE0 comprendre nos reflexions techniques, mais aussi les aider sur leurs probl\xE9matiques m\xE9tiers.<br/>J'ai eu la chance de travailler avec des clients tel que La SPA, M\xE9decin du Monde, L'Institut du Cerveau, Ordre de Malte, L'Institut Curie.... et bien d'autres encore."},"1":{title:"Obtention de mon dipl\xF4me Architecte D\xE9veloppeur Logiciel",shortDescription:"Epitech est une \xE9cole d'ing\xE9nieur en informatique, sp\xE9cialis\xE9e dans les domaines du d\xE9veloppement logiciel et de l'informatique industrielle.",longDescription:"Durant mes \xE9tudes, j'ai eu le temps de bien maitriser les langages C et C++, mais d\xE8s que l'occasion se pr\xE9sentait, je fon\xE7ais sur des technos moderne comme NodeJS ou Go. Gr\xE2ce \xE0 l'apprentissage d'Epitech, j'ai appris \xE0 \xEAtre autonomme et \xE0 m'adapter \xE0 des environnements diff\xE9rents. J'ai \xE9galement appris \xE0 travailler en \xE9quipe et \xE0 \xEAtre responsable."},"2":{title:"Ing\xE9nieur Data",shortDescription:"Aide \xE0 la mise en place du syst\xE8me de recommendation de produits personnalis\xE9es.",longDescription:"Le syst\xE8me \xE9tait presque d\xE9ploy\xE9 et finalis\xE9, je me suis charge de l'int\xE9gralit\xE9 des flux temps-r\xE9els pour la mise \xE0 jour du syst\xE8me de recommendation en Java et sur GCP (Dataflow)."},"3":{title:"Freelance d\xE9veloppeur web fullstack",shortDescription:"Pendant plus d'un an, j'ai travaill\xE9 pour plusieurs clients sur plusieurs projets.",longDescription:"J'ai principalement d\xE9velopp\xE9 des sites vitrines ainsi qu'un site de gestion de rendez-vous pour une agence de formation d'anglais. J'ai utilis\xE9 PHP (Laravel) et React."},"4":{title:"Formateur en d\xE9veloppement web",shortDescription:"Formateur au sein d'Epitech pour des \xE9tudiants en \xE9cole marketing, commerce et communication.",longDescription:"Apprentissage par le biais de cours et de projets \xE0 la programmation web : HTML, CSS, JS, SQL, PHP et Wordpress.<br/>L'objectif \xE9tait de montrer les bases de la programmation web pour qu'ils comprennent comment est fait un site internet et combien \xE7a vaut r\xE9ellement."},"5":{title:"D\xE9veloppeur Fullstack",shortDescription:"Cr\xE9ation de plugins d'int\xE9gration pour des CRM/frameworks e-commerce au syst\xE8me de recommendations de produits personnalis\xE9es.",longDescription:"J'ai d\xE9velopp\xE9 des int\xE9grations en PHP pour les frameworks : Prestashop, Magento, Drupal et Wordpress. J'ai \xE9galement l\xE9g\xE8rement travaill\xE9 sur le syst\xE8me de recommendation de produits personnalis\xE9s de Nuukik en Java."}};export{e as default};
